import { useState } from 'react';
import {motion} from 'framer-motion'
import Layout from '../components/Layout'
import Destacados from '../components/Destacados'
import * as D from '../css/dashboardstyle'
import Carousel from 'react-multi-carousel'

const responsivedos = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5,
      partialVisibilityGutter: 10
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 6,
      partialVisibilityGutter: 10
    },
    tablet: {
      breakpoint: { max: 1024, min: 601 },
      items: 6,
      partialVisibilityGutter: 10
    },
    mobile: {
      breakpoint: { max: 600, min: 0 },
      items: 2,
      partialVisibilityGutter: 10
    }
  };


 
const Dashboard = () => {
const [value, setValue] = useState();

const bares = ['bar1', 'bar2', 'bar3', 'bar4', 'bar5', 'bar6', 'bar7', 'bar8', 'bar9', 'bar10']
 
    return (
        <motion.div>
            <Layout title="Diner App - Dashboard ">
                <D.DashboardWrapper>
                    <Destacados />
                    <De.TitleDes>Restaurantes:</De.TitleDes>
                <Carousel
                partialVisible
                 responsive={responsivedos}
                 draggable
                 minimumTouchDrag={80}
                 ssr={true}
                 infinite={true}
                 arrows={false}>
                     {bares.map((item, index) => {
                         return(
                             <De.LocalesWrapper key={index}>
                                <De.LocalWrapp key={index} background={item}></De.LocalWrapp>
                                <De.Pe> Resto Lorem </De.Pe>
                            </De.LocalesWrapper>
                         )
                     })}
                </Carousel>
                <De.TitleDes>Bares:</De.TitleDes>
                <Carousel
                partialVisible
                 responsive={responsivedos}
                 draggable
                 minimumTouchDrag={80}
                 ssr={true}
                 infinite={true}
                 arrows={false}>
                     {bares.reverse().map((item, index) => {
                         return(
                             <De.LocalesWrapper key={index}>
                                <De.LocalWrapp key={index} background={item}></De.LocalWrapp>
                                <De.Pe> Bares Lorem </De.Pe>
                            </De.LocalesWrapper>
                         )
                     })}
                </Carousel>
                <De.TitleDes>Favoritos:</De.TitleDes>
                <Carousel
                partialVisible
                 responsive={responsivedos}
                 draggable
                 minimumTouchDrag={80}
                 ssr={true}
                 infinite={true}
                 arrows={false}>
                     {bares.map((item, index) => {
                         return(
                             <De.LocalesWrapper key={index}>
                                <De.LocalWrapp key={index} background={item}></De.LocalWrapp>
                                <De.Pe> Favoritos  </De.Pe>
                            </De.LocalesWrapper>
                         )
                     })}
                </Carousel>
                </D.DashboardWrapper>
            </Layout>
        </motion.div>
      );
}
 
export default Dashboard;
